import React from 'react';
import './Cards.css';
import osm from "./map.js"
import {MapContainer,TileLayer} from "react-leaflet";




  const BasicMap = () => {
     const [ centre,setcentre] = useState({ lat: 13.084622, lng: 80.248357});
     const ZOOM_LEVEL = 9;
     const mapRef = useRef();

     return(
       <>
       <header title='react leaflet Map Example'/>
       <div className = 'row'>
         <div className='col text-centre'>
          <h2>React-leaflet - basic Openstreet maps</h2>
          <P>hello</P> 
          <div className='col'>
            <map
              centre={centre}
              zoom={ZOOM_LEVEL}
              >
                <TileLayer url = {osm.maptiler.url} attribution={osm.maptiler.attribution} />
              </map>
              </div>
              </div>
              </div>
              </>
     );
  };

export default Map;
